import React, { useState, useEffect } from 'react';
import { getUsers } from '../api/userApi';

function UserList() {
    const [users, setUsers] = useState([]);

    useEffect(() => {
        async function fetchUsers() {
            try {
                const usersData = await getUsers();
                setUsers(usersData);
            } catch (error) {
                console.error('Error fetching users:', error);
            }
        }
        fetchUsers();
    }, []);

    return (
        <div>
            <h1>Admin Page</h1>
            <table>
                <thead><tr><th>Customer</th><th>Company</th><th>Admission Status</th></tr></thead><tbody>
                    {users.map((user, index) => (<tr key={index}> {/* Utilisez une clé unique pour chaque élément */}
                            <td>{user.username}</td>
                            <td>{user.company}</td>
                            <td>{user.validation ? (user.validation.is_validated ? 'Accepted' : 'Pending') : []}</td></tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default UserList;
